import { Counter_Decrement, Counter_Increment, Counter_Reset } from "./counterRedux"

export const action_Increment=(value)=>({ type:Counter_Increment , payload:(value) })
export const action_Decrement=(value)=>({ type: Counter_Decrement , payload:(value)})
export const action_Reset=(value)=>({ type: Counter_Reset, payload: { value: 0 } })
